  "OSW1A": {
    title: "OSW1A Walmart via 104 - Oswego - From Downtown (04/01/2025)",
    stops: [
      "W Bridge St & W 2nd St",
      "Route 104 & George St",
      "Lowe's Home Improvement",
      "Walmart - Oswego"
    ],
    rows: [
      ["07:10 AM", "07:16 AM", "---", "07:18 AM"],
      ["09:10 AM", "09:16 AM", "---", "09:18 AM"],
