    stops: [
      "W Bridge St & W 2nd St",
      "Simeon Dewitt Apartments Osw",
      "Oswego County Office Complex",
      "Brandonwood Apartments Oswego",
      "Lowe's Home Improvement",
      "Walmart - Oswego"
    ],
    rows: [
      ["07:50 AM", "---", "07:57 AM", "08:05 AM", "08:09 AM", "08:15 AM"],
