      ["09:30 PM", "---", "---", "09:43 PM", "09:47 PM", "09:53 PM"]
    ]
  }
};

function ScheduleTable({ route }) {
  const schedule = scheduleData[route];

  if (!schedule) {
    return <p>No schedule available for this route.</p>;
  }

  const { title, stops, rows } = schedule;

  return (
    <TableWrapper>
      <h3>{title}</h3>
      <StyledTable>
        <Caption>Scheduled Arrival Times</Caption>
        <thead>
          <tr>
            {stops.map((stop, index) => (
              <Th key={index}>{stop}</Th>
            ))}
          </tr>
        </thead>
        <tbody>
          {rows.map((row, index) => (
            <tr key={index}>
              {row.map((time, cellIndex) => (
                <Td key={cellIndex}>{time}</Td>
              ))}
            </tr>
          ))}
        </tbody>
      </StyledTable>
    </TableWrapper>
  );
}

export default ScheduleTable;
